Mayor Eric Adams may have lost more than $1,000 of his first City Hall paycheck in just four days after converting it into cryptocurrency during a plunge in the market. 

From the beginning of the day on Friday until Monday morning, bitcoin’s price plunged by about 15.9%, while ethereum fell 24.3%.
